import Navbar from '../navbar/Navbar';
import Head from 'next/head';
const Layout = (props) => {
  return (
    <div style={{ width: '100%' }}>
      <Head>
        <link
          href='https://fonts.googleapis.com/css2?family=Montserrat&display=swap'
          rel='stylesheet'
        />
      </Head>
      <Navbar></Navbar>
      {props.children}
    </div>
  );
};

export default Layout;
